//pages/Nav.js
import React from "react";
import './headerMenu.css';
function headerMenu() {
  return (
    <div>
    <div className = "MenuBar">
      <div class = "Menucontents" id = "kangwonNow">지금의 강원</div> 
      <div class = "Menucontents"  id = "TripPlace">여행지</div>
      <div class = "Menucontents" id = "TripInfo">여행정보</div>
      <div class = "Menucontents" id = "Reserv">예약하기</div>
      
    </div>
    <div class = "hoverMenu">
        

      </div>

      <div class="dropdown">
      <button class="dropbtn">Dropdown</button>
      <div class="dropdown-content">
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
      </div>
    </div>
    </div>
  );
}

export default headerMenu;
